create table nts_container
(
    id               bigint(32) auto_increment comment '编号'
        primary key,
    container_id     varchar(64)            null comment '集装箱编号',
    container_type   varchar(8)             null comment '集装箱类型',
    container_size   varchar(32)            null comment '集装箱尺寸',
    customer_name    varchar(255)           null comment '客户名称',
    oem              varchar(255)           null comment '集装箱品牌',
    container_model  varchar(16)            null comment '集装箱型号',
    container_status tinyint(1)  default 0  null comment '禁用标识 0-禁用 1-启用',
    dept_id          bigint                 null comment '企业/部门编号',
    user_id          bigint                 null comment '用户ID',
    delete_flag      tinyint(1)             null comment '删除标志 1-正常状态 2-已删除',
    create_time      datetime               null comment '创建时间',
    update_time      datetime               null comment '修改时间',
    create_by        varchar(64) default '' null comment '创建者',
    update_by        varchar(64) default '' null comment '更新者'
)
    comment '集装箱信息表';

create index index_container
    on nts_container (container_id);

